import ExpenseItem from './components/ExpenseItem.js';

function App() {
  const expenses = [
    {title: 'Car Insurance', amount: 294.67, date: new Date().toISOString()},
    {title: 'Car Insurance 2', amount: 294.67, date: new Date().toISOString()},
    {title: 'Car Insurance 3', amount: 294.67, date: new Date().toISOString()},
    {title: 'Car Insurance 4', amount: 294.67, date: new Date().toISOString()},
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem 
        title={expenses[0].title} 
        amount={expenses[0].amount} 
        title={expenses[0].date}>
      </ExpenseItem>

      <ExpenseItem title={expenses[1].title} amount={expenses[0].amount} title={expenses[0].date}></ExpenseItem>
      <ExpenseItem title={expenses[2].title} amount={expenses[0].amount} title={expenses[0].date}></ExpenseItem>
      <ExpenseItem title={expenses[3].title} amount={expenses[0].amount} title={expenses[0].date}></ExpenseItem>   
    </div>
  );
}

export default App;
